import React from 'react';
import Grid from '@material-ui/core/Grid';

function ControlPanel() {

    return(
        <Grid 
        container 
        spacing={0}
        direction="row"
        justify="center"
        align-items="stretch"
        style={{height: "100%"}}
        >
            <Grid item xs={4} style={{backgroundColor:"#abc123", height: "75%"}}>
            </Grid>
            <Grid item xs={4} style={{backgroundColor:"#292f6a", height: "25%"}}>
            </Grid>
            <Grid item xs={4} style={{backgroundColor:"#a1b2c3", height: "25%"}}>
            </Grid>
        </Grid>
    );
}

export default ControlPanel;
